 import { useState } from 'react';

function Bonus({incrementBonus,store}) {

  return (
    <div className="card">
      <div className="container">
        <h4>
          <b>Bonus Component</b>
        </h4>
        <h3>Total Point : ${store.getState().bonus.points}</h3>

        <button onClick={incrementBonus}>Increment +</button>
      </div>
    </div>
  );
}

export default Bonus;
